import { StatusBar } from 'expo-status-bar';
import { Button, StyleSheet, Text, View,TextInput } from 'react-native';


export default function LoginScreen( {navigation} ) {

  function userup(text) {
    console.log(text);
  }
  function passup(text) {
    console.log(text);
  }

  return (
    <View style={styles.container}>
      <View style={styles.panel}>
        <Text style={styles.titles}>School:</Text>
        <View style={styles.school}><Text style={styles.schooltxt}>Leibniz Gymn. Neustadt</Text></View>
        <Text style={styles.titles}>User:</Text>
        <TextInput style={styles.userinput} placeholder='Username' onChangeText={userup} />
        <Text style={styles.titles}>Password:</Text>
        <TextInput style={styles.userinput} secureTextEntry={true} placeholder='Password' onChangeText={passup} />
        <Button title='Login' />
      </View>
      <StatusBar style="auto" />
    </View>
  );
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  panel: {
    padding: 20,
    width: '85%',
  },
  school: {
    backgroundColor: 'lightgrey',
    padding: 8,
    borderRadius: 10,
  },
  schooltxt: {
    textAlign: 'center',
    fontSize: 18,
  },
  titles: {
    fontSize: 20,
    marginTop: 10,
    marginBottom: 6,
    fontWeight: 'bold',
  },
  userinput: {
    fontSize: 18,
  }
});
